insert into L_MAXLABELS (L_MAXLABELSID, OWNERID, VALUE, LANGCODE, ROWSTAMP) VALUES (L_MAXLABELSSEQ.nextval, 887266, '<tr><td class=“买方hdr1”>MAXIMO采购解决方案</td></tr><tr><td class=“买方文本”>您可以使用这些额外的MAXIMO功能与供应商进行实时沟通，简化您的采购体验。</td></tr><tr><td></td></tr><tr><td><table width=“96%”border=“0”cellspacing=“0”cellpadding=“2”align=“right”><tr valign=“top”><td nowrap class=“buyer\u hdr2”align=“right”>Maximo工作流-</td><td class=“buyer\u text”>动态定义和管理您的采购流程和员工通知。</td><tr valign=“top”><td nowrap class=“buyer\u hdr2”align=“right”>桌面请购单-</td><td class=“buyer\u text”>从互联网仓库、供应商的在线目录中搜索和请求材料，以及电子商务网站和市场。</td></tr><tr valign=“top”><td nowrap class=“buyer\u hdr2”align=“right”>Maximo电子商务适配器-</td><td class=“buyer\u text”>发送和接收与供应商、合作伙伴的实时交易，和市场。</td></tr><tr valign=“top”><td nowrap class=“买方hdr2”align=“right”>Maximo OCS-</td><td class=“买方文本”>通过Maximo在线商务服务将Maximo采购沟通扩展到您的供应商。</td></tr></table></td></tr><td></td></tr>', 'ZH', MAXROWSTAMPSEQ.nextval);
